import React from 'react';
import circular from "../assets/circle.png";
import styles from "./CircularGraph.module.css";

export default function CircularGraph() {
  return (
    <div className={styles.circular}>
        <img style={{boxShadow: "rgba(0, 0, 0, 0.24) 0px 3px 8px",borderRadius: "0.5rem",height:"205px"}} src={circular} alt='circulargraph'/>
    </div>
  )
}
